import {uploadPhoto } from "./utils.js";
import { createUser } from "./utils.js";

let body;
let names
export default function handleProfileSignup(){
    uploadPhoto().then((data) =>{
         body = data.body;
    })
   createUser().then((e)=>{
         names = `${e.firstName} ${e.lastName}`;
    }).then(()=>{console.log(`${body} ${names}`)
})
}
handleProfileSignup()
